import React from 'react'
import DemoContainer from './containers/DemoContainer'
import './App.css'

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body className="App-body">
        <DemoContainer />
        <div style='flex: 1;'>hi</div>
      </body>
    </div>
  );
}

export default App;
